    render() {
        return (
            <div>
                <div>
                    <TopNavbar/>
                </div>
                <div>
                    <img src="https://images.squarespace-cdn.com/content/v1/57f0499ed1758e2d78db7dbe/1592156602777-K1YJGBAQDVOG8XZGW4TL/ke17ZwdGBToddI8pDm48kMXRibDYMhUiookWqwUxEZ97gQa3H78H3Y0txjaiv_0fDoOvxcdMmMKkDsyUqMSsMWxHk725yiiHCCLfrh8O1z4YTzHvnKhyp6Da-NYroOW3ZGjoBKy3azqku80C789l0luUmcNM2NMBIHLdYyXL-Jww_XBra4mrrAHD6FMA3bNKOBm5vyMDUBjVQdcIrt03OQ/me.jpg?format=500w" ></img>

                </div>
                <div>
                    <BottomNavbar/>
                </div>
                
                
            </div>
        )
    }
}
